  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "### Data cleaning"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 50,
   "metadata": {},
   "outputs": [],
   "source": [
    "chars_to_remove = ['+', '$', 'M', ',']\n",
    "cols_to_clean = ['Installs', 'Size', 'Price']\n",
    "\n",
    "for col in cols_to_clean:\n",
    "    for char in chars_to_remove:\n",
    "        apps[col] = apps[col].astype(str).str.replace(char, '')\n",
    "        \n",
    "    apps[col] = pd.to_numeric(apps[col], errors = 'coerce')"
   ]
  },
